function Header() {
  return (
    <div className='flex-row bg-red-300 justify-between'>
      <span className='w-10 h-10 bg-yellow-500 m-5'>COM1</span>
      <span className='w-10 h-10 bg-yellow-500 m-5'>COM2</span>
      <span className='w-10 h-10 bg-yellow-500 m-5'>COM3</span>
      <span className='w-10 h-10 bg-yellow-500 m-5'>COM4</span>
      <span className='w-10 h-10 bg-yellow-500 m-5'>COM5</span>
    </div>
  );
}

function Body() {
  return <div className='flex-col bg-teal-200'>Body</div>;
}

function Footer() {
  return <div className='flex-col'><div className='mt-auto'>FOOTER</div></div>;
}

function App() {
  return (
    <div>
      <header>
        <Header />
      </header>
      <body>
        <Body />
      </body>
      <footer>
        <Footer />
      </footer>
    </div>
  );
}

export default App;
